import Header from "./components/Header";
import Home from "./pages/Home";
import { BrowserRouter as Router, Routes, Route, Navigate, useLocation } from 'react-router-dom'
import Blog from "./pages/Blog";
import {  } from 'react-spring'

function App() {
  const location = useLocation()
  const transitions = useTransition()


  return (
    <Router>
      <div className="bg-bg-img overflow-hidden h-screen w-screen bg-cover md:bg-contain">
        <div className="bg-black h-full bg-opacity-25">
          <Header />
          <div className="h-full w-full items-center flex justify-center">
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path='blog' element={<Blog />} />
              <Route path="*" element={<Navigate to='/' replace />} />
            </Routes>
          </div>
        </div>
      </div>
    </Router>
  );
}

export default App;
